import React, { useEffect, useState } from "react";
import { useActions } from "../../../hooks/useActions";
import { useTypedSelector } from "../../../hooks/useTypedSelector";
import { BrandsState } from "../../../types/brand";
import "./BrandsFilter.css";

const BrandsFilter = () => {
  const { brands } = useTypedSelector((state) => state.brand);
  console.log(brands);

  const { fetchBrands } = useActions();

  useEffect(() => {
    fetchBrands();
  }, []);

  return (
    <>
      <p className="filterTitle"> Бренды </p>
      <div className="filterBrands">
        {brands.map((el) => (
          <div key={el.id} className="brandsList">
            <input type="checkbox" />
            <p> {el.title} </p>
          </div>
        ))}
      </div>
    </>
  );
};

export default BrandsFilter;
